import React from 'react'
import { Button } from 'react-bootstrap';

const WeatherButton = () => {
  return (
    <div>
      <Button variant="warning">현재 위치</Button>
      <Button variant="warning">토론토</Button>
      <Button variant="warning">캘거리</Button>
      <Button variant="warning">몬트리올</Button>
      <Button variant="warning">퀘백</Button>
    </div>
  )
}

export default WeatherButton
